import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "/Users/fardinmdgolam/Desktop/Main/Study/Uni Courses/Fall 24/CSCI Soft Dev/Projects/hamburger/src/pages/Layout";
import Home from "/Users/fardinmdgolam/Desktop/Main/Study/Uni Courses/Fall 24/CSCI Soft Dev/Projects/hamburger/src/pages/Home";
import One from "/Users/fardinmdgolam/Desktop/Main/Study/Uni Courses/Fall 24/CSCI Soft Dev/Projects/hamburger/src/pages/One";
import Two from "/Users/fardinmdgolam/Desktop/Main/Study/Uni Courses/Fall 24/CSCI Soft Dev/Projects/hamburger/src/pages/Two";
import NoPage from "/Users/fardinmdgolam/Desktop/Main/Study/Uni Courses/Fall 24/CSCI Soft Dev/Projects/hamburger/src/pages/NoPage";

{/* 
  
  Purpose: component demonstrates the react-router-dom 
  Author(s): Terry Goldsmith
*/}

export default function MyPages() {
  return (
    <BrowserRouter>                               {/* uses the browser built in path history */}
      <Routes>                                    {/* container for each Route */}
        <Route path="/" element={<Layout />}>     {/* each nested Route has "/" prefixed to it */}
          <Route index element={<Home />} />      {/* a Route ties a path to a component - index is top level */}
          <Route path="one" element={<One />} />  {/* path "/one" tied to component One */}
          <Route path="two" element={<Two />} />  {/* path "/two" tied to component Two */}
          <Route path="*" element={<NoPage />} /> {/* "/*" implies all other paths tied to NoPage */}
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
